// Monitor position and check exit conditions
const positionData = $node["prepare-symbols"].json;
const position = positionData.position;
const spyPrice = positionData.spy_price;
const quotes = $input.item.json.quotes;

// Get option quotes
const shortQuote = quotes[position.short_leg];
const longQuote = quotes[position.long_leg];

if (!shortQuote || !longQuote) {
  return {
    error: 'Could not get option quotes',
    position: position,
    should_close: false
  };
}

// Calculate spread value
const shortMid = (shortQuote.bp + shortQuote.ap) / 2;
const longMid = (longQuote.bp + longQuote.ap) / 2;
const spreadValue = shortMid - longMid;

// Calculate P&L
const initialCredit = parseFloat(position.credit_received);
const contracts = position.quantity;
const pnl = (initialCredit - spreadValue) * 100 * contracts;
const pnlPercentage = (pnl / (initialCredit * 100 * contracts)) * 100;

// Calculate time to expiry
const now = new Date();
const marketClose = new Date();
marketClose.setHours(16, 0, 0, 0);
const hoursToExpiry = Math.max(0.1, (marketClose - now) / (1000 * 60 * 60));

// Estimate delta
const moneyness = spyPrice / parseFloat(position.short_strike);
const timeDecay = Math.exp(-hoursToExpiry / 8);
const shortDelta = -0.40 * Math.exp(-2 * Math.pow(moneyness - 1, 2)) * timeDecay;

// Prepare snapshot
const snapshot = {
  trade_id: position.trade_id || position.id,
  timestamp: new Date().toISOString(),
  spy_price: spyPrice,
  spread_bid: shortQuote.bp - longQuote.ap,
  spread_ask: shortQuote.ap - longQuote.bp,
  spread_mid: spreadValue,
  current_pnl: pnl,
  pnl_percentage: pnlPercentage,
  short_delta: shortDelta,
  long_delta: shortDelta * 0.5,
  time_to_expiry: hoursToExpiry,
  theta_decay: initialCredit * 0.1 * (1 / Math.sqrt(hoursToExpiry))
};

// Check exit conditions
let shouldClose = false;
let closeReason = '';

if (pnlPercentage >= 50) {
  shouldClose = true;
  closeReason = 'PROFIT_TARGET';
} else if (pnlPercentage <= -200) {
  shouldClose = true;
  closeReason = 'STOP_LOSS';
} else if (shortDelta <= -0.60) {
  shouldClose = true;
  closeReason = 'DELTA_BREACH';
} else if (hoursToExpiry < 0.5) {
  shouldClose = true;
  closeReason = 'TIME_DECAY';
}

const spyMovement = ((spyPrice - parseFloat(position.initial_spy_price)) / parseFloat(position.initial_spy_price)) * 100;

return {
  position: position,
  snapshot: snapshot,
  should_close: shouldClose,
  close_reason: closeReason,
  spy_movement: spyMovement,
  hours_to_expiry: hoursToExpiry
};

